import React from "react";
import Navbar from "../Component/Navbar";
import CarbonCalculator from "../Component/Calc";
import Landing from "../Component/Landing";
import FrequentlyAsked from "../Component/FrequentlyAsked";
function Home() {
  return (
    <div>
      <Navbar />
      <div style={{ marginTop: '100px' }}> {/* Adjust spacing for Navbar */}
        <Landing />
      </div>
      <div style={{ marginTop: '0px' }}> {/* Add spacing between Landing and Calculator */}
        <CarbonCalculator />
      </div>
      <div>
          <FrequentlyAsked/>
        </div>
    </div>
  );
}

export default Home;
